import React                from 'react';
import styled               from 'styled-components';
import PollAgendaItem       from '../components/Agenda';

import { Colors }           from '../components/theme/Colors';
import history              from '../history'

const PageWrapper = styled.div`
  background-color: ${Colors.LightBlue};
  position: absolute;
  right: 0;
  left: 0;
  top: 0;
  bottom: 0;
`;

class MeetingRoomScreen extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    <PageWrapper>
      <PollAgendaItem medium
                  width={600}
                  title={'Poll Title'}
                  description={'Description of the poll... very informative.'}
                  options={['Option 1', 'Option 2', 'Option 3']}
                  handleOptionClick={this.handleOptionClick}
                  selectedBubble={this.state.selectedBubble}
                  handleSubmit={this.handleSubmit}
                  unselected={unselected} submit={submit} resubmit={resubmit} submitted={submitted}/>
    </PageWrapper>
  }

};

export default MeetingRoomScreen;
